import React from "react";
import { Container, Form } from "semantic-ui-react";

const aboutStyle = {
    marginTop: `20em`,
    fonstSize: `6em`
}
const aboutHeaderStyle = {
    fonstSize: `20em`
}
const listStyle = {
    marginTop: `4em`,
    fontSize: `2em`
    }


function About () {
    return (
        <div>
        <Container className="ui center aligned container" style={aboutStyle} >
        <div style={aboutHeaderStyle} className=" ui header">Events:</div>
        <div style={listStyle} class="ui list">
            <div class="item">
                <div class="header">New York City</div>
                 A lovely city
                </div>
            <div class="item">
                <div class="header">Chicago</div>
                Also quite a lovely city
                </div>
            <div class="item">
                <div class="header">Los Angeles</div>
                    Sometimes can be a lovely city
                </div>
            <div class="item">
                <div class="header">San Francisco</div>
                 What a lovely city
                </div>
        </div>
        </Container>
        </div>
    );
}

export default About;
